import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible
    await page.waitForSelector('#searchInput', { timeout: 5000 });

    // Focus and type into the search input (simulate user typing "ip")
    await page.click('#searchInput');
    await page.type('#searchInput', 'ip');

    // Wait for the search suggestions dropdown to appear
    await page.waitForSelector('.search-suggestions', { timeout: 5000 });

    // Take screenshot of suggestions visible
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions_visible.png'));

    // Extract suggestion items text
    const suggestionTexts = await page.$$eval('.suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion if available
    if (suggestionTexts.length > 0) {
      await page.click('.suggestion-item');
      // Wait for search results to render (wait for .search-results or .results-count)
      await page.waitForSelector('.search-results,.results-count', { timeout: 5000 });
    }

    // Take screenshot after selecting suggestion and search results loaded
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results_after_select.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_results_after_select.png'));

    // Extract the search results count and first result title
    let resultsCount = '';
    let firstResultTitle = '';
    if (await page.$('.results-count')) {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    }
    if (await page.$('.product-title')) {
      firstResultTitle = await page.$eval('.product-title', el => el.textContent.trim());
    }

    return {
      success: true,
      action: "Tested search autocomplete: typed query, verified suggestions, selected suggestion, and verified search results.",
      extractedData: {
        suggestionTexts,
        resultsCount,
        firstResultTitle
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
